script: |
  super -f tsv -I q3274.sql | sort > q3274.out

inputs:
  - name: q3274.sql
    data: |
      SELECT ALL NULLIF ( + 91, - cor0.col0 ) + - ( cor0.col0 + - col2 / cor0.col2 ) AS col1 FROM tab0 AS cor0 GROUP BY cor0.col0, cor0.col2;
  - name: tab0

outputs:
  - name: q3274.out
    data: |
      49
      66
      9
